import React from 'react'
import dataShop from '../db/dataShop'

export default function productScreen(props) {
    const product=dataShop.products.find(x=> x._id=== props.match.params.id)
    return (
        <div className="row">
            <div className="col-2">

            </div>
            <div className="col-1">
            <img
                  className="medium"
                  src={`${process.env.PUBLIC_URL}/images/${product.image}`}
                  alt={product.name}
                />
            </div>
            <div className="col-1">

            </div>

        </div>
    )
}
